import React, { Component } from 'react'
import { Doughnut } from 'react-chartjs-2'

export default class WinningPercentage extends Component {

  render() {
    return (
      <div>
      WinningPercentage
        <Doughnut
          // data=
          width={750}
          height={500}
          options={{
            title: {
              display: true,
              fontsize: 200
            },
            legend: {
              display: true,
              position: "bottom"
            }
          }}
        />
      </div>
    )
  }
}
